import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and fill search input
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'iPhone');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_filled.png'));

    // Click search button using multiple selector strategies
    const searchBtn = await page.waitForSelector('.search-btn', { timeout: 5000 });
    await searchBtn.click();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_clicked.png'));

    // Wait for results and extract data
    await page.waitForSelector('.product-card, .products-grid, .search-results', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_results.png'));

    // Extract search results data
    const extractedData = {
      resultsCount: await page.textContent('.results-count').catch(() => 'N/A'),
      productTitles: await page.$$eval('.product-title', titles => 
        titles.slice(0, 5).map(t => t.textContent.trim())
      ).catch(() => [])
    };

    return {
      success: true,
      action: "Searched for 'iPhone' products and extracted results",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to search for 'iPhone' products",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
